import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { AccountService } from '../_services/account.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {
  registrationForm: FormGroup;
  submitted = false;

  constructor(private formBuilder: FormBuilder,  
    private accountService: AccountService, private router: Router) {
    this.registrationForm = this.formBuilder.group({
      name: ['', Validators.required],
      age: ['', [Validators.required, Validators.min(1)]],
      email: ['', [Validators.required, Validators.email]],
      phone: ['', Validators.required],
      password: ['', [Validators.required, Validators.minLength(6)]]
    });
  }

  get formControls() {
    return this.registrationForm.controls;
  }

  onSubmit() {
    this.submitted = true;

    if (this.registrationForm.valid) {
      this.accountService.register(this.registrationForm.value).subscribe(
        response => {
          console.log('Registration successful', response);
          this.router.navigate(['']);
        },
        error => {
          // Handle error
          console.error('Registration failed', error);
        }
      );
    }
  }
}
<div class="registration-container">
  <h2>Register</h2>
  <form [formGroup]="registrationForm" (ngSubmit)="onSubmit()">
    <div>
      <label>Name</label>
      <input formControlName="name" type="text" />
      <div *ngIf="submitted && formControls['name'].errors" class="error">
        Name is required.
      </div>
    </div>

    <div>
      <label>Age</label>
      <input formControlName="age" type="number" />
      <div *ngIf="submitted && formControls['age'].errors" class="error">
        Age is required and must be greater than 0.
      </div>
    </div>

    <div>
      <label>Email</label>
      <input formControlName="email" type="email" />
      <div *ngIf="submitted && formControls['email'].errors" class="error">
        Valid email is required.
      </div>
    </div>

    <div>
      <label>Phone</label>
      <input formControlName="phone" type="tel" />
      <div *ngIf="submitted && formControls['phone'].errors" class="error">
        Phone is required.
      </div>
    </div>

    <div>
      <label>Password</label>
      <input formControlName="password" type="password" />
      <div *ngIf="submitted && formControls['password'].errors" class="error">
        Password is required and must be at least 6 characters.
      </div>
    </div>

    <button type="submit">Register</button>
    <button routerLink="/login" type="submit">Login</button>
  </form>
</div>
